import React from 'react';
import '../ItemPage3/ItemPage3.css';
import { Row, Col, Button } from 'react-bootstrap';

import {Box} from '../../components/Box/Box.js';

const ItemPage3 = () => {
    return(
        <>
        <Row>
            <Col>
                <Box text="*Body Model*" />
            </Col>
            <Col>
                <Box text="*Color Palette/Settings*"/>
            </Col>
        </Row>
        <br></br>
        <Box style={{height: "200px"}} text="*Description*" />
        <Button href="">TBA</Button>
        </>
    )
}

export default ItemPage3;
